import React from 'react'
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Carousel = ({value}) => {
  const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };
  return (
    <div>
      <Slider {...settings}>
      <div className='slider-pic'>
        <img src={value.image} />
        </div>
      {/* {Carouselvalue.homeCarousel.map((item, key) =>
          <img src={item.image} />
      )} */}
    </Slider>
    </div>
  )
}

export default Carousel
